import React from 'react';
import { View, Text, Image, ScrollView } from 'react-native';

const Profile = () => {
  return (
    <ScrollView>
      <View style={{ flexDirection: 'row' }}>
        <View>
          <Text>Previous Game List</Text>
          {/* Add previous game list content here */}
        </View>
        <View>
          <Text>Upcoming Game List</Text>
          {/* Add upcoming game list content here */}
        </View>
      </View>

      <View style={{ alignItems: 'center' }}>
        <Text>Welcome, User Name</Text>
        <Image
          source={{ uri: 'https://example.com/fake-pic.jpg' }}
          style={{ width: 200, height: 200 }}
        />
        <View>
          <Text>Assigned Groups</Text>
          <View>
            {/* Add options for assigned groups */}
            <Text>Group One</Text>
            <Text>Group Two</Text>
            <Text>Group Three</Text>
            {/* ... Add more options as needed */}
          </View>
        </View>
      </View>
    </ScrollView>
  );
};

export default Profile;
